    [],nt"revision_timestamp": "2016-07-27T22:59:23.100457",nt"name": "the-road-inventory-of-national-bison-range",nt"isopen":
    false,nt"url": null,nt"notes": "To determine the relative needs of the
    U.S. Fish and Wildlife Service, the Federal Highway Administration (FHWA) was asked
    to inventory all public access and administrative (Service use only) roads and parking
    lots and provide a condition assessment of each. This report summarizes the inventory
    for National Bison Range.u00a0All roads and parking lots were mapped using Trimble
    GPS units and visually assessed for condition using the RSL method of evaluation
    developed at Utah State University. A cost estimate for maintenance and construction
    of roads is provided in the report.",nt"license_title": "License Not Specified",nt"extras":
